lyrics:
Writer(s): Rodgers/Hart
If they asked me, I could write a book;
About the way you walk, and whisper;
And look
I could write a preface;
On how we met;
That the world will never forget
And the simple;
Secret of the plot;
Is just to tell them;
That I love you, alot
Then the world discovers;
As my book ends;
How to make two lovers of friends

I'm doing my Christmas dreaming a little early this year, no sign of snow around;
And yet I go around hearing jingle bells ringing in my ear
Your promise must be the reason, the happy season is here;
So I'm doing my Christmas dreaming a little early this year

Writer(s): B. Lane/ E.Y. Harburg
I look at you and suddenly
Something in your eyes I see;
Soon begins bewitching me
It's that old devil moon;
That you stole from the skies
It's that old devil moon in your eyes
You and you glance;
Make this romance;
Too hot to handle
Stars in the night;
Blazing their light;
Can't hold a candle;
To your razzle-dazzle
You've got me flyin' high and wide;
On a magic carpet ride;
Full of butterflies inside
Wanna cry, wanna croon
Wanna laugh like a loon
It's that old devil moon in your eyes
Just when I think, I'm;
Free as a dove
Old devil moon
Deep in your eyes
Blinds me with love
